import Link from 'next/link';
<link rel="stylesheet" type="text/css" href="tst.css"></link>

const linkStyle = {
  
};

const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
  </div>
);

export default Header;
